import React from "react";
import { Link } from "react-router-dom";
import './home.css'

function Home() {
  return (
    <div className="home">
      <div className="hero">
        <div className="text-section">
          <h1>
            Hi, my name is <span className="highlight">Robb.</span>
          </h1>
          <p>
            I'm an <span className="bold">independent creative developer</span> from
            Abergavenny, South Wales.
          </p>
        </div>
        <div className="image-section">
          <img src="/avatar.png" alt="Avatar" className="avatar" />
        </div>
      </div>
      <div className="scroll-text">SCROLL</div>
    </div>
  );
}
export default Home;
